import axios from "axios";

export default function Chat1() {
  const [msg, setMsg] = useState("");
  const [msgs, setMsgs] = useState("");
  useEffect(() => {
    axios.get("http://localhost:5001/", (req, res) => {
      req.json(setMsgs(res.data));
      console.log(msgs);
    });
  }, []);
  return (
    <div>
      <div>
        <div>Message :{}</div>
        <form>
          <input
            type="text"
            placeholder="Message here..."
            onChange={(e) => setMsg(e.target.vlaue)}
            value={msg}
          ></input>
          <button>Send</button>
        </form>
      </div>
    </div>
  );
}
